import React from "react";
import "./style.css";

function Navbar() {
  return (
    <nav className="navbar navbar-dark bg-dark">
    <ul className="nav">
      <li className="nav-item"><a className="navbar-brand" href="https://github.com/jygibson/bbc2.git">
      <p>the beauty bunny collective </p>
      </a>
      </li>
      <li className="nav-item"><p id="score-text">Score:   </p><span id="score"></span></li>
      <li><p id="top-score-text"> | Top Score:  </p> <span id="top-score"></span></li>
    </ul>
    </nav>
  );
}

export default Navbar;
